import { useState } from "react";
import MyButton from "../UI/MyButton/MyButton"
import MyInput from "../UI/MyInput/MyInput";

const AddNewForm = () =>
{
    const [data, setData] = useState({name: '', date: '', time: '', place: '', body: ''})
    return (
        <div>
            <form>
                <MyInput placeholder="Название"></MyInput>
                <MyInput placeholder="Дата"></MyInput>
                <MyInput placeholder="Время"></MyInput>
                <MyInput placeholder="Место"></MyInput>
                <MyInput placeholder="Описание"></MyInput>
                <MyButton>Добавить</MyButton>
            </form> 
        </div>
    )
}

export default AddNewForm;
